import { useState } from "react";
import "./Navbar.css"

const Navbar = () => {
    
    const [scrollPage, setScrollPage] = useState(false);

    window.onscroll = () => { 
        let offSetScreen = window.pageYOffset;
        console.log(offSetScreen);
        if(offSetScreen > 200)
            setScrollPage(true);
        else
            setScrollPage(false);
    };

    

    return (
        <div className={!scrollPage ? "Navbar" : "Navbar teste"}>
            <div className="LogoBox">
                <img className="LogoImage"/>
            </div>
            <div className="UBox">
                <ul>
                    <li>In√≠cio</li>
                    <li>Eventos</li>
                    <li>Contato</li>
                    <li>Quem somos</li>
                </ul>
            </div>
        </div>
    );

}

export default Navbar;
